import React, { Component } from 'react'
import ReactDOM from 'react-dom';
import CreateUser from './createUser'
import userApi from './Data/userApi.json'
import style from './style.css'

class MainPage extends Component{
    render(){

        const data = this.props; 

        return(
            <div>
                <h1>Users: </h1>
                <div className='list-cards' >

                {data.map(()=>{

                    <div className='card-user'>



                    <div className='item'>{userApi.id}</div>
                    <div className='item'>{userApi.name}</div>
                    <div className='item'>{userApi.email}</div>

                    <button>Edit</button>

                    </div>
                })}



                </div>
                <button>Create user</button>
            </div>
        )
    }
}


ReactDOM.render(<MainPage json={userApi} />,document.getElementById('root'))
